import React, { useRef, useState, useEffect } from 'react';
import { Dock } from 'primereact/dock';
import { Tooltip } from 'primereact/tooltip';
import { Dialog } from 'primereact/dialog';
import { Terminal } from 'primereact/terminal';
import { TerminalService } from 'primereact/terminalservice';
import { Galleria } from 'primereact/galleria';
import { Toast } from 'primereact/toast';
import { Tree } from 'primereact/tree';
import { Menubar } from 'primereact/menubar';
import { PhotoService } from './PhotoService';
import { NodeService } from './NodeService';
import './navbar.css';

export default function DockNavbar() {
    const [displayTerminal, setDisplayTerminal] = useState(false);
    const [displayFinder, setDisplayFinder] = useState(false);
    const [images, setImages] = useState(null);
    const [nodes, setNodes] = useState(null);
    const toast = useRef(null);
    const toast2 = useRef(null);
    const galleria = useRef(null);

    const dockItems = [
        {
            label: 'Finder',
            icon: () => <img alt="Finder" src="https://primefaces.org/cdn/primereact/images/dock/finder.svg" width="100%" />,
            command: () => setDisplayFinder(true),
        },
        {
            label: 'Terminal',
            icon: () => <img alt="Terminal" src="https://primefaces.org/cdn/primereact/images/dock/terminal.svg" width="100%" />,
            command: () => setDisplayTerminal(true),
        },
        {
            label: 'App Store',
            icon: () => <img alt="App Store" src="https://primefaces.org/cdn/primereact/images/dock/appstore.svg" width="100%" />,
            command: () => toast2.current.show({ severity: 'error', summary: 'Error', detail: 'An unexpected error occurred.' }),
        },
        {
            label: 'Photos',
            icon: () => <img alt="Photos" src="https://primefaces.org/cdn/primereact/images/dock/photos.svg" width="100%" />,
            command: () => galleria.current.show(),
        },
        {
            label: 'GitHub',
            icon: () => <img alt="GitHub" src="https://primefaces.org/cdn/primereact/images/dock/github.svg" width="100%" />
        },
        {
            label: 'Trash',
            icon: () => <img alt="Trash" src="https://primefaces.org/cdn/primereact/images/dock/trash.png" width="100%" />,
            command: () => toast.current.show({ severity: 'info', summary: 'Trash', detail: 'Empty Trash' }),
        }
    ];

    const menubarItems = [
        { label: 'Finder' },
        { label: 'File', items: [{ label: 'New' }, { label: 'Delete' }] },
        { label: 'Edit', items: [{ label: 'Undo' }, { label: 'Redo' }] },
        { label: 'Help' },
    ];

    const commandHandler = (text) => {
        let response;
        if (text === 'date') response = 'Today is ' + new Date().toDateString();
        else if (text === 'greet') response = 'Hello!';
        else if (text === 'random') response = Math.floor(Math.random() * 100);
        else response = 'Unknown command: ' + text;

        TerminalService.emit('response', response);
    };

    useEffect(() => {
        TerminalService.on('command', commandHandler);
        PhotoService.getImages().then(setImages);
        NodeService.getTreeNodes().then(setNodes);

        return () => TerminalService.off('command', commandHandler);
    }, []);

    return (
        <div className="dock-demo">
            <Toast ref={toast} />
            <Toast ref={toast2} position="top-center" />
            <Tooltip target=".p-dock-action" showDelay={150} />
            <Menubar model={menubarItems} />
            <Dock model={dockItems} />
            <Dialog visible={displayTerminal} onHide={() => setDisplayTerminal(false)} style={{ width: '30vw' }}>
                <Terminal prompt="primereact $" welcomeMessage="Welcome to PrimeReact Terminal!" />
            </Dialog>
            <Dialog visible={displayFinder} onHide={() => setDisplayFinder(false)} style={{ width: '30vw', height: '30vh' }}>
                <Tree value={nodes} />
            </Dialog>
            <Galleria ref={galleria} value={images} circular fullScreen showThumbnails={false} showItemNavigators />
        </div>
    );
}
